import {React,useEffect,useState} from 'react'
import MenuItem from '../components/Menu/MenuItem'


const Menu = () => {

    //const [menu, setMenu] = useState(0);

    useEffect(()=>{
        
    })






    const menu = [{
        name: "Amila nuwan",
        price: 600,
    },
    {
        name: "nuwan",
        price: 600,
    }
]
    

    const MenuList = ()=>{
        return menu.map((aName)=>{

            return(
                <MenuItem 
                          key ={aName.id} 
                          name = {aName.name}
                          price = {aName.price}  />
            )
        })
    }

    return (
        <React.Fragment>
            <h1>Menu</h1>

            <MenuList/>
            
        </React.Fragment>
    )
}

export default Menu
